import React from "react";
import './TodoSearch.css'


function TodoSearch() {
    const [patito, setPatito] = React.useState('Jesus');

    const onSearchValueChange = (event) => {
        console.log(event.target.value);
    };

    return [
        <input 
            className="TodoSearch"
            placeholder="Cebolla"
            onChange={onSearchValueChange}
        />,
        <p>{patito}</p>
    ]
}

export { TodoSearch } ;
